import React from "react";

export default function AiRecommendations() {
  return (
    <div className="pageWrapper">
      <div className="card">
        <h2>AI Investment Recommendations</h2>
        <p>Smart insights based on your portfolio will appear here.</p>
      </div>
    </div>
  );
}
